import Card from '../Card/Card';
import styled from "./Cards.module.css"
export default function Cards({ characters, onClose }) {
   return (
      <div className={styled.container}>
         {characters.map(
            ({ id, name, status, species, gender, origin, image }) => {
               return (
                  <Card
                     key={id}
                     id={id}
                     name={name}
                     status={status}
                     species={species}
                     gender={gender}
                     origin={origin.name}
                     image={image}
                     onClose={onClose}
                  />
               )
            })}
      </div>
   );
}
